	props.reversed = reversed;
	cjs.MovieClip.apply(this,[props]);

	this.actionFrames = [0,1];
	// timeline functions:
	this.frame_0 = function() {
		this.stop();
		document.addEventListener("keydown", handleKeyDown);
		document.addEventListener("keyup", handleKeyUp);
		
		var root = this;
		var speed = 25;
		
		
		
		var bg_mc = root.bg_mc;
		var sol_mc = root.sol_mc;
		var lantern_mc = root.lantern_mc;
		var legs_mc = sol_mc.legs_mc;
		
		handleKeyUp(null);
		
		function handleKeyDown(event){
			 //console.log(bg_mc.x);
			//console.log(root.blueHead_mc.scaleX);
			//
		console.log("framenum " + legs_mc.currentFrame);
			if(legs_mc.currentFrame >= 13){
				//console.log("leggyleg");
				legs_mc.gotoAndPlay("walking");
			}
			
			if (event.keyCode == 39 && bg_mc.x > -9593) {
				sol_mc.scaleX = 1
				bg_mc.x = bg_mc.x - speed;
			}
			if (event.keyCode == 37 && bg_mc.x < 707 ){
				sol_mc.scaleX = -1
				bg_mc.x = bg_mc.x + speed;
			}
		}
		
		function handleKeyUp(event){
			legs_mc.gotoAndPlay("standing");
		}
		/*
		#############################
		#							#
		#	HANDLE LANTERN MOTION	#
		#							#
		#############################
		*/
		var lanternInitX = lantern_mc.x;
		var lanterInitY = lantern_mc.y;
		lightMove()
		function lightMove(){
		
			createjs.Tween.get(lantern_mc, {override:false}).to({x: lanternInitX, y: lanterInitY+15}, 500, createjs.Ease.linear).call(cycle);
		
		}
		function cycle(){
		
			createjs.Tween.get(lantern_mc, {override:false}).to({x: lanternInitX, y: lanterInitY-15}, 500, createjs.Ease.linear).call(lightMove);
		
		}
		
		
		/*
		#############################
		#							#
		#		HANDLE BOTS			#
		#							#
		#############################
		*/
		
		var bot1 = bg_mc.bot1_mc;
		var bot2 = bg_mc.bot2_mc;
		var bot3 = bg_mc.bot3_mc;
		bot1.addEventListener("click",handleClickBot1);
		bot2.addEventListener("click",handleClickBot2);
		bot3.addEventListener("click",handleClickBot3);
		function handleClickBot1(){
			var beep_snd1 = createjs.Sound.play("bot_1_sound");
			// bot1.play();
		}
		function handleClickBot2(){
			var beep_snd2 = createjs.Sound.play("bot_2_sound");
			// bot2.play();
		}
		function handleClickBot3(){
			var beep_snd3 = createjs.Sound.play("bot_3_sound");
			// bot3.play();
		}
		
		
		
		
		this.play_btn.addEventListener("click",handleClickPlay);
		function handleClickPlay(){
			var wind_snd = createjs.Sound.play("wind");
			root.play();
			
		}
	}
